import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchRequirementsByEmail } from "../redux/requirementsSlice";
import { fetchProposalsByEmail } from "../redux/proposalsSlice";
import { fetchTasksByClientEmail } from "../redux/taskSlice";

function ClientDashboard() {
  const dispatch = useDispatch();
  const [tab, setTab] = useState("requirements");

  const email = useSelector((state) => state.auth.user?.email);
  const user = useSelector((state) => state.auth.user);

  const { requirements } = useSelector((state) => state.requirements);
  const { proposals } = useSelector((state) => state.proposals);
  const { tasks } = useSelector((state) => state.tasks);

  useEffect(() => {
    if (email) {
      dispatch(fetchRequirementsByEmail(email));
      dispatch(fetchProposalsByEmail(email));
      dispatch(fetchTasksByClientEmail(email));
    }
  }, [email, dispatch]);

  return (
    <div className="container mt-4">
      <h2>Welcome, {user?.fullName}</h2>

      <div className="btn-group my-3">
        <button onClick={() => setTab("requirements")} className="btn btn-primary">My Requirements</button>
        <button onClick={() => setTab("proposals")} className="btn btn-primary">Received Proposals</button>
        <button onClick={() => setTab("tasks")} className="btn btn-primary">Tasks</button>
        <button onClick={() => setTab("feedback")} className="btn btn-primary">Give Feedback</button>
        <button onClick={() => setTab("profile")} className="btn btn-outline-dark">Profile</button>
      </div>

      <hr />

      {tab === "requirements" && (
        <>
          <h4>My Requirements</h4>
          {requirements.length === 0 ? <p>No requirements yet.</p> :
            <ul className="list-group">
              {requirements.map(req => (
                <li key={req.req_id} className="list-group-item">
                  <h5>{req.title}</h5>
                  <p>{req.description}</p>
                  <strong>Budget: ₹{req.budget}</strong>
                </li>
              ))}
            </ul>
          }
        </>
      )}

      {tab === "proposals" && (
        <>
          <h4>Received Proposals</h4>
          {proposals.length === 0 ? <p>No proposals received.</p> :
            <ul className="list-group">
              {proposals.map(p => (
                <li key={p.proposalId} className="list-group-item">
                  <h5>From Vendor #{p.vendor.vendor_id}</h5>
                  <p>{p.summary}</p>
                  <strong>Status:</strong> {p.status}
                </li>
              ))}
            </ul>
          }
        </>
      )}

      {tab === "tasks" && (
        <>
          <h4>Tasks</h4>
          {tasks.length === 0 ? <p>No tasks assigned.</p> :
            <ul className="list-group">
              {tasks.map(t => (
                <li key={t.taskId} className="list-group-item">
                  <h5>{t.taskName}</h5>
                  <p>{t.taskDescription}</p>
                  <strong>Start:</strong> {t.startDate}<br />
                  <strong>End:</strong> {t.endDate}
                </li>
              ))}
            </ul>
          }
        </>
      )}

      {tab === "feedback" && (
        <>
          <h4>Give Feedback (Demo)</h4>
          <form onSubmit={(e) => {
            e.preventDefault();
            alert("Feedback submitted! (Demo only, not saved)");
          }}>
            <div className="mb-3">
              <label>Vendor ID</label>
              <input type="number" className="form-control" required />
            </div>
            <div className="mb-3">
              <label>Rating (0.0 - 5.0)</label>
              <input type="number" step="0.1" max="5" min="0" className="form-control" required />
            </div>
            <button type="submit" className="btn btn-success">Submit Feedback</button>
          </form>
        </>
      )}

      {tab === "profile" && (
        <>
          <h4>Profile</h4>
          <p><strong>Name:</strong> {user?.fullName}</p>
          <p><strong>Email:</strong> {user?.email}</p>
          <p><strong>Contact:</strong> {user?.contact}</p>
          <p><strong>Role:</strong> {user?.role?.rname}</p>
        </>
      )}
    </div>
  );
}

export default ClientDashboard;
